import React from 'react';
import store from '../store/index';

export default class Lists extends React.Component {
    render() {
        return (
            <div className="lists-wrapper">
                                {store.getState().lists.map((item, idx) => (
                    <Lists key={idx} name={item.name}/>
                ))}
            </div>
        )
    }
}
